import React from 'react';

export async function getStaticProps(context) {
    return {
        props: {}, // will be passed to the page component as props
    }
}

function App(props) {
    return (
        <div>
            <h1>Hello World</h1>
            <p>Teste</p> <h1>Hello World</h1>
            <p>Teste</p> <h1>Hello World</h1>
            <p>Teste</p> <h1>Hello World</h1>
            <p>Teste</p> <h1>Hello World</h1>
            <p>Teste</p> <h1>Hello World</h1>
            <p>Teste</p> <h1>Hello World</h1>
            <p>Teste</p> <h1>Hello World</h1>
            <p>Teste</p> <h1>Hello World</h1>
            <p>Teste</p> <h1>Hello World</h1>
            <p>Teste</p> <h1>Hello World</h1>
            <p>Teste</p> <h1>Hello World</h1>
            <p>Teste</p> <h1>Hello World</h1>
            <p>Teste</p> <h1>Hello World</h1>
            <p>Teste</p> <h1>Hello World</h1>
            <p>Teste</p> <h1>Hello World</h1>
            <p>Teste</p>
        </div>
    );
}

export default App;
